В филиалах Центра  работают спортивные секции:

самбо (молодёжный спортивный клуб «Вымпел» ) – зал борьбы (22х8), тренажёрный зал (7,65х10,78);
настольный теннис (МСК «Ока», «Вымпел»);
пулевая стрельба (МСК «Смена» );
хоккей с шайбой (мкр «Петровское»), тренировочные занятия на базе РУТБ «Ока»;
пауэрлифтинг (МСК «Смена» мкр «Сельхозтехника», тренажёрный зал (8,8 х 4,8);
греко-римская борьба (МСК «Витязь» мкр «Сельхозтехника», зал греко-римской борьбы (8,49х8,95));
лыжные гонки (мкр «Горушки», лыжная трасса проходит в лесном массиве «Глухая);
волейбол (пос. Колосово на базе Алексинского гидрометеорологического техникума).
и творческие кружки:

декоративно-прикладного искусства (вышивка) “Волшебная нить” (МСК “Ока”)
театральный “Экспромт”
декоративно-прикладного искусства (рисование, шитье,поделки) “Заходи и не скучай” (МСК “КЮТ”)
декоративно-прикладного искусства (рисование, поделки, познавательные (право, экология и т.д) лекции “Калейдоскоп”  (МСК «Смена» );
судомоделирования (МСК “КЮТ”)

Прием граждан: вторник, среда, пятница с 9.00 до 13.00 и с 14.00 до 17.00;
суббота с 9.00 до 13.00 и с 14.00 до 16.00;
четверг - неприемный день, день работы с архивными документами.

