Возраст: от 6 до 18 лет
План приема: до 15 детей
Форма обучения: очная
Основные задачи для начального этапа :
- укрепление здоровья и всестороннее физическое развитие подростков;
- постепенный переход к целенаправленной подготовке в избранном виде спорта;
- обучение технике борьбы самбо;
- повышение уровня физической подготовленности;
-отбор перспективных юных спортсменов для дальнейших занятий самбо.

Основные задачи для учебно-тренировочного этапа:
- укрепление здоровья и всестороннее физическое развитие подростков;
- улучшение скоростно-силовой подготовки спортсменов с учетом формирования основных навыков, присущих избранному виду спорта;
- создание интереса к самбо;
- воспитание быстроты движений в упражнениях, не требующих проявления большой силы;
- обучение и совершенствование техники;
- постепенное подведение спортсмена к более высокому уровню тренировочных нагрузок;
- постепенное подведение к соревновательной борьбе путем применения средств, необходимых для волевой подготовки спортсмена.
ПРЕПОДАВАТЕЛИ: 
1.Тренер-преподаватель по самбо Варанкин Владимир Ильич (высшая квалификационная категория)
-награжден Почетной грамотой департамента образования министерства образования Тульской области 2014г "За успехи в организации и совершенствовании работы по дополнительному образованию и многолетний плодотворный труд".
- награжден Почетной грамотой министерства образования Тульской области 2015г за "Значительный личный вклад в воспитание и развитие детей и подростков, высокий профессионализм и преданность делу".
2. Тренер-преподаватель по самбо Орленко Евгений Александрович (первая квалификационная категория)
-награжден почетной грамотой Министерства РФ "За успехи в организации и совершенствовании работы по дополнительному образованию и многолетний плодотворный труд"
-награжден почетной грамотой государственного комитета РФ по физической культуре и спорту "За большой вклад в развитие физической культуры и спорта"
-награжден почетной грамотой администрации Тульской области "За активное участие в организации отдыха, оздоровлении, занятии детей и подростков на территории Тульской области"
3. Тренер-преподаватель по самбо Чадалин Сергей Егорович 
4. Тренер-преподаватель по самбо Клюев Дмитрий Александрович

